import React, { useState } from 'react';
import styled from 'styled-components';
import Card from './Card';

const CardsContainer = styled.div`
  background: pink;
`;

function Cards({ available }) {
  const players = available.map((player) => <Card id={player.id} type={player.type} wildCard={player.wildCard} />)

  return (
    <CardsContainer>
      {players}
    </CardsContainer>
  );
}

export default Cards;
